import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import RequestSend from '../PagesStore/RequestSend';
import MaintenanceStartRequest from "../PagesMechanic/MaintenanceStartRequest";
import MaintenanceSelection from "../PagesMechanic/MaintenanceSelection";

function RoutesComponent() {
    return (
        <BrowserRouter>
            <Routes>
                <Route exact path="/" Component={MaintenanceStartRequest} />
                <Route exact path="/maintenanceStartRequest" Component={MaintenanceSelection} />
            </Routes>
        </BrowserRouter>
    );
}

export default RoutesComponent;
